        VALUES ('b889cdd5-08c0-4fe9-a51a-d3ea6c5c3162', 'JuyU0s8jGiarQirjKo5f', 'Trầu Bà Đế Vương có tên tiếng Anh là Philodendron Imperial thuộc họ Araceae (Ráy). Nguồn gốc của cây...', 'Trầu Bà Đế Vương có tên tiếng Anh là Philodendron Imperial thuộc họ Araceae (Ráy). Nguồn gốc của cây từ đảo Solomon, nguyên sinh ở Indonesia, là dòng cây thân thảo, trong tự nhiên dòng cây này có thể cao hơn 1.5m, nhưng với mục đích trang trí thì MOW sẽ gửi đến các bạn cây với kích cỡ nhỏ để tiện đặt ở bất cứ đâu mình thích. Ngay từ cái tên thì chúng ta đã hiểu được phần nào ý nghĩa của loài cây này, chúng không những thể hiện sự quyết tâm, ý chí vươn lên đến đỉnh cao nhất mà còn mang đến nhiều may mắn, tài lộc đến cho người trồng.  ', False, '6757a1bd-4112-4710-a317-ad86cd0c82c7', 
